(16, '૩૦ દિવસમાં 100+', 15, 'ભારતના ડાયમંડ કિંગ સવજીભાઇ ધોળકિયા, સીરામીક ઉધોગના અગ્રગણ્ય ઉધોગકાર સુરેશભાઇ સોમપુરા, વિશ્વ પ્રસિદ્ધ હાસ્યકારો પદ્મશ્રી શાહબુદ્દીન રાઠોડ, ડૉ. જગદીશ ત્રિવેદી, એકતા ઇન્ફોટેક સર્વિસીસના હાર્દિક સોમપુરા દ્વારા લોન્ચિંગ થયેલ, વિજ્ઞાપનકારોના સહયોગથી તૈયાર થયેલ આ ઍપ સાથે ૩૦ દિવસમાં 100+ ઉધોગપતિઓ, વેપારીઓ, નાગરિકો જોડાયા છે. સૌનું સહૃદય સ્વાગત છે, સૌએ આ ઍપમાંથી સીરામીક ઉધોગની જે સુવિધાઓ મેળવવા આ ઍપ ડાઉનલોડ કરી છે, તે સુવિધાઓ આપવા અમે સતત સતત પ્રયત્ન કરીશું. - ડૉ. કલ્પેશ ત્રિવેદી ઓમી ગૃપ થાનગઢ', '', '2021-09-19 10:20:54', '2021-09-19 10:20:54'),
